INSERT INTO `recipes` (`id`, `username`, `dish_name`, `ingredients`, `cuisine_type`, `dietary_preferences`, `cook_time`, `instruction`, `image_path`, `likes`) VALUES
(18, 'madhu', 'Samosa', 'For the Dough:  2 cups all-purpose flour 1/4 cup oil or ghee (clarified butter) 1/2 teaspoon salt Water, as needed For the Filling:  2 cups boiled and mashed potatoes 1/2 cup boiled green peas 1 tablespoon oil 1 teaspoon cumin seeds 1 teaspoon mustard seeds 1/2 cup finely chopped onions 1 tablespoon finely chopped ginger 1 tablespoon finely chopped garlic 1 to 2 green chilies, finely chopped (adjust to taste) 1/2 teaspoon turmeric powder 1 teaspoon ground coriander 1 teaspoon ground cumin 1 teaspoon garam masala Salt, to taste 2 tablespoons chopped cilantro (coriander leaves) 1 tablespoon lemon juice', 'indian', 'Veg', '50 minutes', '   Prepare the Dough:\r\n\r\nIn a large bowl, combine the all-purpose flour, salt, and oil or ghee.\r\nGradually add water and knead to form a smooth, firm dough.\r\nCover the dough with a damp cloth and let it rest for at least 30 minutes.\r\n2. Prepare the Filling:\r\n\r\nHeat oil in a pan over medium heat. Add cumin seeds and mustard seeds. Allow them to splutter.\r\nAdd chopped onions, ginger, and garlic. Sauté until the onions become translucent.\r\nAdd green chilies and sauté for a minute.\r\nAdd turmeric powder, ground coriander, ground cumin, and garam masala. Mix well.\r\nAdd boiled and mashed potatoes, boiled green peas, salt, and mix everything thoroughly.\r\nCook the mixture for 5-7 minutes, stirring occasionally.\r\nAdd chopped cilantro and lemon juice. Mix well and remove from heat. Allow the filling to cool.\r\n3. Assemble the Samosas:\r\n\r\nDivide the rested dough into equal-sized balls. Roll each ball into a thin oval or round shape.\r\nCut the rolled dough in half to form two semi-circles.\r\nTake one semi-circle and fold it into a cone shape, sealing the edges with a little water.\r\nFill the cone with the prepared potato-pea mixture.\r\nSeal the open edge to form a triangular or pyramid shape.\r\nRepeat the process for the remaining dough and filling.\r\n4. Deep-fry the Samosas:\r\n\r\nHeat oil in a deep pan over medium heat.\r\nOnce the oil is hot, carefully slide in the samosas, a few at a time.\r\nFry until they become golden brown and crispy.\r\nRemove the samosas using a slotted spoon and place them on a paper towel to drain excess oil.\r\nServe the hot samosas with mint chutney or tamarind chutney. Enjoy your delicious homemade Indian samosas! ', , 2);
