INSERT INTO `recipes` (`id`, `username`, `dish_name`, `ingredients`, `cuisine_type`, `dietary_preferences`, `cook_time`, `instruction`, `image_path`, `likes`) VALUES
(20, 'Mrinmoy', 'Mixed noodles', 'For the Noodles:  200g chowmein noodles (boiled according to package instructions) 1 tablespoon oil 1 teaspoon soy sauce 1 teaspoon sesame oil (optional) Salt, to taste For the Stir-Fry:  2 tablespoons oil 1 tablespoon ginger-garlic paste 1 cup thinly sliced onions 1 cup julienned carrots 1 cup thinly sliced bell peppers (mix of colors) 1 cup thinly sliced cabbage 1 cup bean sprouts 1/2 cup thinly sliced mushrooms 1/4 cup thinly sliced spring onions (green part) 2 tablespoons soy sauce 1 tablespoon oyster sauce 1 teaspoon chili sauce or to taste (optional) Salt and pepper, to taste', 'chinese', 'NonVeg', '30 mints', '  Prepare the Noodles:\r\n\r\nBoil the chowmein noodles according to the package instructions.\r\nDrain the noodles and rinse them under cold water to stop the cooking process.\r\nToss the noodles with 1 tablespoon of oil, 1 teaspoon of soy sauce, and sesame oil if using. Set aside.\r\n2. Stir-Fry the Vegetables:\r\n\r\nHeat 2 tablespoons of oil in a wok or large pan over high heat.\r\nAdd ginger-garlic paste and sauté for 1-2 minutes until fragrant.\r\nAdd sliced onions and stir-fry until they are translucent.\r\nAdd julienned carrots, sliced bell peppers, cabbage, bean sprouts, mushrooms, and spring onions. Stir-fry for 3-5 minutes until the vegetables are tender-crisp.\r\n3. Combine Noodles and Vegetables:\r\n\r\nAdd the boiled chowmein noodles to the stir-fried vegetables.\r\nPour soy sauce, oyster sauce, and chili sauce (if using) over the noodles and vegetables.\r\nToss everything together until well combined.\r\nSeason with salt and pepper to taste.\r\n4. Finish and Serve:\r\n\r\nContinue to stir-fry for an additional 2-3 minutes until the noodles are heated through.\r\nGarnish with additional sliced spring onions.\r\nServe hot as is or with your favorite side sauce, such as chili sauce or soy sauce.\r\nEnjoy your homemade Mixed Chowmein! Feel free to customize the vegetables and adjust the seasonings according to your taste preferences. ', , 0);
INSERT INTO `recipes` (`id`, `username`, `dish_name`, `ingredients`, `cuisine_type`, `dietary_preferences`, `cook_time`, `instruction`, `image_path`, `likes`) VALUES
(21, 'Piyalee', 'Nachos', 'For the Nachos:  Tortilla chips (store-bought or homemade) For the Veggie Toppings:  1 cup black beans, cooked and drained 1 cup corn kernels (fresh, frozen, or canned) 1 cup diced tomatoes 1 cup diced bell peppers (a mix of colors) 1/2 cup sliced black olives 1/2 cup sliced jalapeños (optional, for heat) 1 cup shredded cheddar or Mexican blend cheese For Guacamole:  2 ripe avocados 1 small red onion, finely chopped 1-2 cloves garlic, minced 1 medium tomato, diced 1 lime, juiced Salt and pepper, to taste For Salsa:  1 cup diced tomatoes 1/2 cup finely chopped red onion 1/4 cup chopped fresh cilantro 1 lime, juiced Salt, to taste For Sour Cream (optional):  1 cup sour cream', '', 'Veg', '20 mints', '  Prepare the Guacamole:\r\n\r\nIn a bowl, mash the ripe avocados.\r\nAdd chopped red onion, minced garlic, diced tomato, lime juice, salt, and pepper.\r\nMix everything well to form a chunky guacamole. Adjust the seasoning to taste.\r\n2. Prepare the Salsa:\r\n\r\nIn another bowl, combine diced tomatoes, chopped red onion, cilantro, lime juice, and salt. Mix well.\r\n3. Assemble the Nachos:\r\n\r\nPreheat your oven to 375°F (190°C).\r\nOn a large baking sheet or oven-safe dish, spread out a layer of tortilla chips.\r\nEvenly distribute black beans, corn, diced tomatoes, diced bell peppers, black olives, and jalapeños over the chips.\r\nSprinkle shredded cheese over the top.\r\n4. Bake:\r\n\r\nPlace the nachos in the preheated oven and bake for about 10-15 minutes, or until the cheese is melted and bubbly.\r\n5. Add Toppings:\r\n\r\nRemove the nachos from the oven.\r\nSpoon dollops of guacamole and salsa over the nachos.\r\n6. Optional: Add Sour Cream:\r\n\r\nIf desired, you can add dollops of sour cream over the nachos.\r\n7. Serve:\r\n\r\nServe the veggie-loaded nachos immediately.\r\nEnjoy with your favorite beverages!\r\nFeel free to customize the toppings according to your preferences. You can also add other ingredients like diced red or green onions, fresh cilantro, or a drizzle of hot sauce. Nachos are highly versatile, so have fun with the toppings! ', , 0);

